script: |
  super -f text -I q5787.spq | sort > q5787.out

inputs:
  - name: q5787.spq
    data: |
      SELECT - 23 - col1 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + col2 + - - col0 BETWEEN ( + - col1 + - 92 ) AND ( + 65 );
  - name: tab2

outputs:
  - name: q5787.out
    data: |
      -100
      -74
      -90
